import React from "react"
import "./AppStyle.css"

class App extends React.Component{
    render(){
        return(
            <div className="App">
                <div className="header">
                    header
                </div>
                
                <div className="content">
                    content
                </div>
                <div className="footer">
                    footer    
                </div>
            </div>
        )
    }
}

export default App
